import classNames from 'classnames'
import React from 'react'

function BurgerIcon({ isMenuVisible, toggleMenu }) {
  return (
    <div>
      <button onClick={toggleMenu} class="relative group bg-transparent z-50 cursor-pointer">
        <div class="relative flex overflow-hidden items-center justify-center w-[50px] h-[50px] transform transition-all duration-200">
          <div class="flex flex-col justify-between w-[20px] h-[20px] transform transition-all duration-300 origin-center overflow-hidden">
            <div
              class={classNames(
                'bg-mediumblue h-[2px] w-7 transform transition-all duration-300 origin-left',
                { 'rotate-[42deg]': isMenuVisible }
              )}
            ></div>
            <div
              class={classNames(
                'bg-mediumblue h-[2px] w-7 rounded transform transition-all duration-300',
                { '-translate-x-10': isMenuVisible }
              )}
            ></div>
            <div
              class={classNames(
                'bg-mediumblue h-[2px] w-7 transform transition-all duration-300 origin-left',
                { '-rotate-[42deg]': isMenuVisible }
              )}
            ></div>
          </div>
        </div>
      </button>
    </div>
  )
}

export default BurgerIcon
